import React from "react";
import { Typography, Box, Button, Avatar, Input } from "@material-ui/core";

const login = () => {
  return (
    <div style={{  width: "", height: "200px px",background: "#63738A" }}>
      <Box >
        <Box style={{ marginTop:"2px",marginLeft: "2px",marginRight: "20px", background: "#F2F3F7" }}>
          <Typography style={{ alignContent: "center" }}> Register </Typography>
        </Box>
      </Box>
    </div>
  );
};
export default login;
